import{_ as a}from"./plugin-vue_export-helper-c27b6911.js";import{o as i,c as e,e as l}from"./app-d4062e36.js";const h={},r=l('<h1 id="其他" tabindex="-1"><a class="header-anchor" href="#其他" aria-hidden="true">#</a> 其他</h1><h2 id="兑换码有什么用" tabindex="-1"><a class="header-anchor" href="#兑换码有什么用" aria-hidden="true">#</a> 兑换码有什么用？</h2><ul><li>兑换码用于庆祝游戏中的重要事件，以及激励新玩家。</li><li>有时会向内容创作者和大型社区所有者提供兑换码。所有兑换码都有有限的期限和使用次数。</li><li>我们不会应要求提供有效的兑换码列表。玩家必须自己找到当前的兑换码。我们不提供单一的有效兑换码列表。</li></ul><h2 id="阿尔法测试" tabindex="-1"><a class="header-anchor" href="#阿尔法测试" aria-hidden="true">#</a> 阿尔法测试</h2><ul><li>Alpha 测试是一项封闭测试，在发布新版本游戏之前是必需的。目前没有招募测试计划。2022 年 9 月，为了更有效地工作，alpha 测试参与者的数量已经减少。</li></ul><h2 id="如何成为游戏版主" tabindex="-1"><a class="header-anchor" href="#如何成为游戏版主" aria-hidden="true">#</a> 如何成为游戏版主？</h2><ul><li>游戏版主只能由项目管理部门任命。我们不积极招募版主。版主从常规和以积极的方式证明玩家的数量成为用户。</li></ul><h2 id="为什么我的每日奖励日历无法正确显示-即使奖项在日历上标记为-已收到-我也没有收到奖励" tabindex="-1"><a class="header-anchor" href="#为什么我的每日奖励日历无法正确显示-即使奖项在日历上标记为-已收到-我也没有收到奖励" aria-hidden="true">#</a> 为什么我的每日奖励日历无法正确显示？即使奖项在日历上标记为“已收到”，我也没有收到奖励？</h2><ul><li>每日奖励日历每两个月更改一次，每个玩家将有不同的日期。如果更改发生在日历的中间，您收到的奖励可能与您收到的奖励不同，因为您是从另一个日历收到的，并且您将从新日历中获得未来的奖励。</li></ul><h2 id="每日任务" tabindex="-1"><a class="header-anchor" href="#每日任务" aria-hidden="true">#</a> 每日任务</h2><ul><li>每日任务的复杂性随着账户级别的增加而增加。</li><li>玩家每天最多有机会完成5次任务。为了提前开始完成新任务，请单击主菜单中的相应图标。</li><li>此外，随着等级的增加，“跳过”每个任务和整个任务块的成本也会增加。</li></ul><h2 id="坦克模式什么时候来" tabindex="-1"><a class="header-anchor" href="#坦克模式什么时候来" aria-hidden="true">#</a> 坦克模式什么时候来？</h2><ul><li>坦克模式目前正在开发中，迫不及待地想发布它们！这不是一项快速的任务，但团队实际上正在日以继夜地工作，以尽快发布它们。</li></ul><h2 id="机器人太强了-偷走了我的人头。" tabindex="-1"><a class="header-anchor" href="#机器人太强了-偷走了我的人头。" aria-hidden="true">#</a> 机器人太强了，偷走了我的人头。</h2><ul><li>机器人的选择取决于您的技能。尝试改变战术，如果你正在与对手战斗，并且你旁边有一个机器人可以偷走你的人头。当你看到对手的生命值接近零时，停止射击并确保最后一枪是你的。</li></ul><h2 id="你的配对有什么问题-为什么是不平等的-低级玩家遇到高水平玩家。" tabindex="-1"><a class="header-anchor" href="#你的配对有什么问题-为什么是不平等的-低级玩家遇到高水平玩家。" aria-hidden="true">#</a> 你的配对有什么问题？为什么是不平等的？低级玩家遇到高水平玩家。</h2><ul><li>在MW中，对手的选择是基于玩家的技能，而不是他们的水平。精通度会根据玩家最近的输赢不断重新计算，这可确保玩家与同一玩家匹配。战术和技巧在游戏中非常有价值。有时，如果具有相同技能水平的玩家不能立即可用，您将被更高级别的玩家选中。</li></ul><h2 id="我无法支付游戏内购买-下载游戏的费用" tabindex="-1"><a class="header-anchor" href="#我无法支付游戏内购买-下载游戏的费用" aria-hidden="true">#</a> 我无法支付游戏内购买/下载游戏的费用</h2><ul><li>我们有一个官方网站，您可以在其中使用游戏中的用户名和密码登录。有所有的特别优惠和许多付款方式。您也可以从我们的网站下载官方游戏客户端。</li></ul><div class="hint-container warning"><p class="hint-container-title">建议</p><p>不要去官网充值，别问为什么，问就是贵，死贵</p></div><h2 id="我没有查看广告按钮-为什么" tabindex="-1"><a class="header-anchor" href="#我没有查看广告按钮-为什么" aria-hidden="true">#</a> 我没有查看广告按钮，为什么？</h2><h5>尝试通过重置“广告ID”来解决它：</h5><ul><li>打开手机设置</li><li>找到“谷歌”，然后点击它</li><li>点击“广告”</li><li>点击“重置广告ID”，然后点击“确定”</li></ul><div class="hint-container warning"><p class="hint-container-title">小贴士</p><p>如果这没有帮助，则表示确实没有广告，或者您所在地区目前可能没有广告。</p></div>',24),d=[r];function n(t,c){return i(),e("div",null,d)}const o=a(h,[["render",n],["__file","QT.html.vue"]]);export{o as default};
